import React, {Component} from 'react';

class Home extends Component
{
    render()
    {
        return(
            <div>
                {/* <!-- Header --> */}
                <header className="masthead">
                    <div className="container">
                        <div className="intro-text">
                            <div className="intro-lead-in">Welcome To Our Laboratory!</div>
                            <div className="intro-heading text-uppercase">Medical Imaging And Diagnoses</div>
                            <a className="btn btn-primary btn-xl text-uppercase js-scroll-trigger" href="#services">Know More</a>
                        </div>
                    </div>
                </header>
            </div>
        )
    }
}

export default Home;
